import { MapTo } from '@adobe/cq-react-editable-components';
import TTAC from '@t1p1/coe-shared-poc-react/dist/components/TTAC';

/**
 * Example of important a shared component
 */
require('./Ttac.css');

const TtacEditConfig = {
  emptyLabel: '[Text, Title, and CTA Component]',

  isEmpty: function (props) {
    return !props || !props.title;
  },
};

export default MapTo('mysite/components/ttac')(TTAC, TtacEditConfig);
